import React, { Component } from "react";
import { Route, Switch } from "react-router-dom";
import "./App.css";
import HomeDefault from "./components/home/home";
import searchOffer from "./components/searchOffer/SearchOffer";
import TraineeApplications from "./components/traineeApplications/TraineeApplications";
import CompanyOffers from "./components/CompanyOffers/CompanyOffers";
import Param from "./Param";

const Home = ({ match }) => {
  return (
    <Switch>
      <Route exact path={match.url} exact={true} component={HomeDefault} />
    </Switch>
  );
};

const Trainee = ({ match }) => {
  return (
    <Switch>
      <Route exact path={match.url} exact={true} component={searchOffer} />
      <Route
        exact path={match.url + "/my-applications"}
        component={TraineeApplications}
      />
    </Switch>
  );
};
const Company = ({ match }) => {
  return (
    <Switch>
      <Route exact path={match.url} exact={true} component={CompanyOffers} />
      <Route exact path={match.url + "/my-params"} exact={true} component={Param} />
    </Switch>
  );
};

const App = () => {
  return (
    <Switch>
      <Route exact path="/" component={Home} />
      <Route exact path="/trainee" component={Trainee} />
      <Route exact path="/company" component={Company} />
    </Switch>
  );
};
